 ) \nAS \nT(a, b);\nCREATE PROCEDURE testdb11013.dbo.testproc15909()\nAS BEGIN\n  CREATE VIEW testdb11013.dbo.testview17897 \n  AS \n    SELECT * FROM \n    (\n        VALUES(1,2),(2,4)\n    ) \n  AS \n  T(a, b);\nEND;",
